import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Container from 'react-bootstrap/Container';

import Icon from '@mdi/react';
import { mdiAccountCircle } from '@mdi/js';


import './topbar.css';
import TopBarLogo from './logo_hanshin.svg';

const TopBar = () => {
  return <div className='muNavBarContainer'>
    <Navbar className='muNavBar'>
        <Navbar.Brand href='/' className='muNavBarLogoContainer'>
          <img src={TopBarLogo} />
        </Navbar.Brand>

        <NavDropdown align='end' title={<Icon path={mdiAccountCircle} />} alignRight className='muNavBarDropdown'>
          <NavDropdown.Header className='muNavBarDropdownItem' href="#action/3.1">로그인을 해 주세요!</NavDropdown.Header>
          <NavDropdown.Divider className='muNavBarDropdownItem' />
          <NavDropdown.Item className='muNavBarDropdownItem' href="#action/3.4">로그인</NavDropdown.Item>
        </NavDropdown>

    </Navbar>
  </div>;
}

export { TopBar };
